Description:
Viết code ứng dụng chat đơn giản: 
1/ Phía server viết bằng NetCore C#; 
2/ Phía client nhập tên user của mình và đăng nhập ghi thông tin lên server, 
đồng thời hiện danh sách user đang online được trả từ server về; 
Chọn 1 user và gửi 1 mes => user được chọn sẽ nhận được và gửi mes lại. 
=> Chỉ cần code mẫu, không cần đẹp.

Viết C# các tính năng tương tác với Zalo như sau: 
1/ Lấy danh sách request accept; 
2/ Accept; 
3/ Lấy thông tin từ bạn bè (Tên, ngày sinh, số điện thoại ...); 
4/ Lấy danh sách tin nhắn từ bạn bè; 
5/ Gửi trả lời tin nhắn cho bạn bè; 
6/ .. .. .. 
(được ẩn bởi vLance)

Tôi có file APK và IPA cần việt hóa ( Server đã Online Mobile On ) . Bung file APK và IPA ra việt hóa. Anh em nào làm được liên hệ tôi trao đổi cụ thể nhé. [được ẩn bởi vlance]. Có kiến thức C# & Unity; Đam mê sáng tạo game; Kinh nghiệm phát triển game 2D/3D sử dụng Unity ; 
Kinh nghiệm với nền tảng iOS/Android/HTML5 là một lợi thế. 
Call (được ẩn bởi vLance).

Do nhu cầu phát triển nên mình cần một bạn partime Lập Trình Viên Mobile (Ionic, Cordova, Laravel,ANGULAR). Có thể làm việc remote online. Có thể ứng tuyển vị trí fulltime nếu muốn. 
Mô Tả Công Việc 
Tham gia vào nhóm phát triển làm việc trên ứng dụng Hybrid Mobile cho Dự án về Y tế; 
Xây dựng và chỉnh sửa các module, tính năng theo yêu cầu; 
Nghiên cứu công nghệ mới, áp dụng cải tiến business framework 
Yêu Cầu Ứng Viên 
Có kinh nghiệm phát triển các sản phẩm mobile/hybrid mobile; 
Thành thạo các framework iONIC, Cordova, NodeJs, Laravel, Angular; 
Có kinh nghiệm về React là một lợi thế; 
Tư duy lập trình tốt, khả năng giải quyết vấn đề và nắm bắt nhanh công nghệ; 
Khả năng làm việc độc lập và quản lý tốt. 
Quyền lợi được hưởng 
Đánh giá thay đổi thường xuyên theo năng lực và kĩ năng làm việc. 
Luong can ban 7 trieu/thang, tang them tuy theo kinh nghiem. 
Có thể làm việc online khung giờ cố định partime. 
Có thể làm theo tháng vì công việc thường xuyên. 
Note: Ứng viên đăng ký gởi cho mình remote timetable.
